import React from 'react';

function Search(props) {

  const handleSearch = e => {
    if (e.keyCode === 13) {
      props.updateSearch('test2');
    }
  }

  return (
    <>
      <input type='text'
        onChange={e => setSearch(e.target.value)}
        onKeyDown={handleSearch}
      />
    </>
  );
};

export default Search;
